import React from "react";
import { useState } from "react";
import { Link } from "react-router-dom";
import "./Home.css";
 import img from "../images/425-500.jpg";
import img2 from "../images/lucas-5tRmLGguL3Q-unsplash.jpg";
import logo from "../images/Logo.png";
import hamburger from "../images/hamburger.png";
<link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css"></link>

function Home() {
  const [media , setMedia] = useState("")
  function changecolour(){
    let button = document.getElementById("id1")
    
    button.onClick.style.backgroundColor = ""
    // (button).foreach.style.backgroundColor = "Black";
  }
  var onresize = function(e) {
    //note i need to pass the event as an argument to the function
   const screen = e.target.outerWidth;
   console.log(typeof(screen))
    // let height = e.target.outerHeight;
    // console.log(width ,"width")
    // console.log(height ,"height")
    if(screen < 760 && screen > 761){
      // console.log("mobile320")
      setMedia("mobile")
    }else{
    }
    if(screen > 761) {
      // console.log("mobile766")
      setMedia("tablet")
    }else{
    
    }
    // if(screen < 1020) {
    //   setMedia("tablet")
    // }
    console.log(media, "media")
 }
 window.addEventListener("resize", onresize);
  // let screen=  window.screen.availWidth 

  // if(screen < "766" ){
  //   console.log("mobile320")
  // }else{
  //   console.log("else2")
  // }

  // console.log(screen , "screen") 
  return (
    
    <div>
      <div>
        <header>
          <nav class="navbar">
            <img class="Logo" src={logo} alt=""></img>
            <div class="divlinks">
            <ul class="ullinks">
              <li class="Link1">
                <Link class="Links"  to="/">
                  Home
                </Link>
              </li>
              <li class="Link2">
                <Link class="Links" to="/aboutus">
                  About us
                </Link>
              </li>
              <li class="Link3">
                <Link class="Links"  to="/contactus">
                 Contact us</Link>
              </li>
            </ul>
            </div>
          </nav>  
          <nav class="hamnav"> 
      <img class="hamburgericon" alt="" src={hamburger} onClick={changecolour}></img>
     
         
            <div class="div1"></div>
            <div class="div1"></div>
            <div class="div1"></div>
            <ul >
              <li >
                <Link to="/">
                  Home
                </Link>
              </li>
              <li >
                <Link  to="/aboutus">
                  About us
                </Link>
              </li>
              <li >
                <Link   to="/contactus">
                 Contact us</Link>
              </li>
            </ul>
            
          
          
          </nav>
          {/* <img class="Logo" src={logo} alt=""></img> */}
         
          
       
        </header>
         <div class="imagecontainermobile">
        <img src={img} alt="Avatar" class="imagemobile" />
        <img src={img} alt="Avatar" class="imagemobile" />
        <img src={img} alt="Avatar" class="imagemobile" />
      </div> 
      <div class="imagecontainerlaptop">
        <img src={img2} alt="Avatar" class="imagelaptop" />
        <img src={img2} alt="Avatar" class="imagelaptop" />
        <img src={img2} alt="Avatar" class="imagelaptop" />
      </div>
      </div>
      {/* <div>
        <div class="container" id="container">
          <img src={img} alt="Avatar" class="image" id="image"/>
           <div class="overlay" id="Text-student">
            <div class="text">Hello World</div>
           <button >Back</button> 
          </div> 
          <img src={img} alt="Avatar" class="image" />
          <img src={img} alt="Avatar" class="image" />
        </div>
      </div> */}
 
    </div>
  );
}

export default Home;
